import { Fragment, useState, useCallback } from 'react';
import { GoogleMap, Marker, useLoadScript, GroundOverlay } from '@react-google-maps/api';
import axios from 'axios';

function App() {
  const { isLoaded } = useLoadScript({
    googleMapsApiKey: 'AIzaSyCTr_9M2JzhFcNt0xSIdndldz-DYmpqa94'
  });

  const [markerPosition, setMarkerPosition] = useState(null);
  const [mapCenter, setMapCenter] = useState({ lat: 40.39, lng: 35.68 });
  const [tileUrl, setTileUrl] = useState(null);
  const [acquisitionTime, setAcquisitionTime] = useState(null);
  const [nextAcquisitionTime, setNextAcquisitionTime] = useState(null);
  const [satellite, setSatellite] = useState(null);
  const [details, setDetails] = useState(null);


  const handleMapClick = useCallback((event) => {
    const { latLng } = event;
    const lat = latLng.lat();
    const lng = latLng.lng();

    setMarkerPosition({ lat, lng });
    setMapCenter({ lat, lng });

    axios.post('http://127.0.0.1:5000/get_image', { latitude: lat, longitude: lng })
      .then((response) => {
        console.log("Response Data:", response.data);
        const { tile_url, metadata, acquisition_time, next_acquisition_time, satellite } = response.data;
        setTileUrl(tile_url);
        setAcquisitionTime(acquisition_time);
        setNextAcquisitionTime(next_acquisition_time);
        setSatellite(satellite);
        setDetails(metadata);
      })
      .catch((error) => {
        console.error("Error fetching satellite data:", error);
      });

  }, []);


  if (!isLoaded) return <div>Loading...</div>;

  return (
    <Fragment>
      <div className='container'>
        <h1 className='text-center'>Satellite Reflectance Map</h1>
        <div className="info-panel">
          {acquisitionTime && <p>Last Acquisition Date: {acquisitionTime}</p>}
          {nextAcquisitionTime && <p>Next Acquisition Date: {nextAcquisitionTime}</p>}
          {satellite && <p>Satellite: {satellite}</p>}
        </div>
        <h1 className='text-center'>Metadata</h1>
        <div className="info-panel">
        {details &&  (
            <>
              <p>Landsat Product Identifier L2: {details.Landsat_Product_Identifier_L2}</p>
              <p>Landsat Product Identifier L1: {details.Landsat_Product_Identifier_L1}</p>
              <p>Landsat Scene Identifier: {details.Landsat_Scene_Identifier}</p>
              <p>Date Acquired: {details.Date_Acquired}</p>
              <p>Collection Category: {details.Collection_Category}</p>
              <p>Collection Number: {details.Collection_Number}</p>
              <p>WRS Path: {details.WRS_Path}</p>
              <p>WRS Row: {details.WRS_Row}</p>
              <p>Nadir/Off Nadir: {details.Nadir_Off_Nadir}</p>
              <p>Roll Angle: {details.Roll_Angle}</p>
              <p>Date Product Generated L2: {details.Date_Product_Generated_L2}</p>
              <p>Date Product Generated L1: {details.Date_Product_Generated_L1}</p>
              <p>Start Time: {details.Start_Time}</p>
              <p>Stop Time: {details.Stop_Time}</p>
              <p>Station Identifier: {details.Station_Identifier}</p>
              <p>Day/Night Indicator: {details.Day_Night_Indicator}</p>
              <p>Land Cloud Cover: {details.Land_Cloud_Cover}</p>
              <p>Scene Cloud Cover L1: {details.Scene_Cloud_Cover_L1}</p>
              <p>Ground Control Points Model: {details.Ground_Control_Points_Model}</p>
              <p>Ground Control Points Version: {details.Ground_Control_Points_Version}</p>
              <p>Geometric RMSE Model: {details.Geometric_RMSE_Model}</p>
              <p>Geometric RMSE Model X: {details.Geometric_RMSE_Model_X}</p>
              <p>Geometric RMSE Model Y: {details.Geometric_RMSE_Model_Y}</p>
              <p>Processing Software Version: {details.Processing_Software_Version}</p>
              <p>Sun Elevation L0RA: {details.Sun_Elevation_L0RA}</p>
              <p>Sun Azimuth L0RA: {details.Sun_Azimuth_L0RA}</p>
              <p>Data Type L2: {details.Data_Type_L2}</p>
              <p>Sensor Identifier: {details.Sensor_Identifier}</p>
              <p>Satellite: {details.Satellite}</p>
              </>
          )}
        </div>



        <div style={{ width: "100%", height: "90vh" }}>
          <GoogleMap
            center={mapCenter}
            zoom={5}
            mapContainerStyle={{ width: "100%", height: "90vh" }}
            onClick={handleMapClick}
          >
            {markerPosition && <Marker position={markerPosition} />}

            {tileUrl && (
              <GroundOverlay
                url={tileUrl}
                bounds={{
                  north: mapCenter.lat + 0.1,
                  south: mapCenter.lat - 0.1,
                  east: mapCenter.lng + 0.1,
                  west: mapCenter.lng - 0.1
                }}
                opacity={0.6}
              />
            )}
          </GoogleMap>
        </div>
      </div>
    </Fragment>
  );
}

export default App;
